import { Tabs } from 'antd';

const onChange = (key) => {
  return(
    key == 1?'1번입니다':'아닙니다'
  )
};
const items = [
  {
    key: '1',
    label: `센터`,
    children: {onChange},
  },
  {
    key: '2',
    label: `서버`,
    children: `Content of Tab Pane 2`,
  },
  {
    key: '3',
    label: `스위치`,
    children: `Content of Tab Pane 3`,
  },
  {
    key: '4',
    label: `라우터`,
    children: `Content of Tab Pane 3`,
  },
  {
    key: '5',
    label: `센서`,
    children: `Content of Tab Pane 3`,
  },
];
const Tab = () => <Tabs defaultActiveKey="1" items={items} onChange={onChange} />;
export default Tab;
